@georgf this is where we are at the moment in terms of migrating to redux. It seems that the reducers, action creators, and store are functioning properly (tested these locally thanks to the Redux developer tools); however, I'm having some issues connecting these to the components themselves. 

Here, I've only made the changes to the `VersionSelector` component; once we've been able to troubleshoot the issue there, I think it should be an easier move toward getting the remaining components in line, as well.

@openjck @wlach dropping a line here to see if either of y'all have experience in Redux; if so, I'd love some input on what you think I'm doing wrong! Thank you!

