@georgf @chutten this PR contains the `getPercentile` function, as well as a call for the median and 95th percentile in a `componentWillMount` function.

I added the data file back in locally so that we can test the functions while I'm still working on making the fetch for the data function.

I also added an eslint rule to warn about missing semicolons, as @chutten recommended, and was warned about quite a few (  ), so I made those smaller changes.

